import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import LaterSeenOrder from "./LaterSeenOrder";


class LaterOrderContainer extends React.Component {


    render() {
        let look
        if (!this.props.item) {
            look = ""
        } else {
            look = this.props.item[this.props.match.params.id]
        }
        return (
            <LaterSeenOrder item={look}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.laterSeenPage.item,


    }


}

export default compose(
    connect(mapStateToprops, {}),
    withRouter,
)(LaterOrderContainer)
